import React, { Component } from 'react';
import '../App.css';
import { BrowserRouter as Router, Link, Route } from 'react-router-dom'
import List from '../components/List'
import About from '../components/About'
// import Form from '../components/Form'



class Home extends Component {
    render() {
        return (
            <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav mr-auto">
                    <li className="nav-item active">
                        <a className="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
                    </li>
                    <li className="nav-item dropdown">
                        <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                            Dropdown
                                </a>
                        <div className="dropdown-menu" aria-labelledby="navbarDropdown">
                            <Router>
                                <a className="dropdown-item" href="#">Go to list</a>
                                <div className="dropdown-divider"></div>
                                <a className="dropdown-item" href="#">Go to about</a>

                                <Route className="dropdown-item" path="/markets" component={List} />
                                        <Link to="/markets" className='list'>Go to List</Link>
                                        <br />
                                <Route className="dropdown-item" path="/about" component={About} />
                                        <Link to="/about" className='list'>Go to About</Link>
                            </Router>
                        </div>
                    </li>
                </ul>

            </div>
            // <Router>
            //     <div>
            //         <Route path="/markets" component={List} />
            //         <Link to="/markets" className='list'>Go to List</Link>
            //         <br />
            //         <Route path="/about" component={About} />
            //         <Link to="/about" className='list'>Go to About</Link>
            //     </div>
            // </Router>
        )
    }

}

export default Home;
